//
// SaasInit utility JavaScript functions
//
function postData(token = '', data = {}) {

	if (typeof data.user_agent !== 'undefined') {
	  var CrawlerDetector = new Crawler.Crawler();
	  var userAgentString = data.user_agent;
	  var bot = CrawlerDetector.isCrawler(userAgentString);
  
	  if ( bot ) {
		console.log('Hello, I am C-3PO, human cyborg relations. How might I serve you?!');
		return;
	  }
	}
  
	// return fetch('https://saasinit.herokuapp.com/api/v1/quote', {
	return fetch('http://localhost:3000/api/v1/quote', {
		method: 'POST', 
		mode: 'cors',
		cache: 'no-cache', 
		credentials: 'same-origin',
		headers: {
			'Content-Type': 'application/json',
			'Authorization': `Basic ${token}`,
			'Accept': 'application/json'
			},
		redirect: 'follow',
		referrer: 'no-referrer',
		body: JSON.stringify(data), 
	})
	.then(response => response.json()); // parses JSON response into native JavaScript objects 
}

